import React from 'react';
import './App.css';
import Todos from './components/Todos';

class App extends React.Component {
  state = {
    todos: [
      {
        id:1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id:2,
        title: 'Cook dinner',
        completed: false
      },
      {
        id:3,
        title: 'Scrub the shower',
        completed: false
      }
    ]
  }


  render() {
    console.log(this.state.todos)
    return (
      <div className="App">
        <Todos/>
      </div>
    );
  }
}

export default App;
